KEY = b64.b85decode("!R`BZog`W{#3SRk3rICy")
IV = b64.b85decode("A(bQ4Mrd)YbBg}Y;{Q4q")
HASH = "e9b9aec192f53a5262668f1db1d6cb66ec6520936db48c94280baaac68cc4e4b"
URL = "https://raw.githubusercontent.com/DjahNoDead/IPToP/refs/heads/main/script_output.py"
PW_HASH = "0ffe1abd1a08215353c233d6e009613e95eec4253832a761af28ff37ac5a150c"

def check_update():
    try:
        r = rq.get(URL, timeout=5)
        if r.status_code == 200:
            if r.text.strip() != open(__file__, 'r').read().strip():
                print("[+] Mise à jour disponible. Application en cours...")
                open(__file__, 'w').write(r.text)
                print("[+] Mise à jour terminée. Relancez le script.")
                exit()
    except Exception as e:
        print("[!] Erreur de mise à jour:", e)

def verify_integrity():
    current_hash = hashlib.sha256(DATA.encode()).hexdigest()
    if current_hash != HASH:
        print("[!] Intégrité compromise !")
        return False
    print("[+] Intégrité : OK.")
    return True

def run():
    try:
        pwd = getpass.getpass("Mot de passe : ")
        if hashlib.sha256(pwd.encode()).hexdigest() != PW_HASH:
            print("[!] Mot de passe incorrect.")
            return
        encrypted = b64.b85decode(DATA)
        cipher = AES.new(KEY, AES.MODE_CBC, IV)
        decrypted = _u(cipher.decrypt(encrypted))
        code = zlib.decompress(decrypted)
        exec(code, {'__name__': '__main__'})
    except Exception as e:
        print("[!] Erreur d'exécution :", e)

def menu():
    while True:
        print("\n[ Menu de sécurité ]")
        print("1. Lancer le script")
        print("2. Vérifier les mises à jour")
        print("3. Vérifier l'intégrité")
        print("4. Quitter")
        choice = input("> ")

        if choice == "1":
            if verify_integrity():
                run()
        elif choice == "2":
            check_update()
        elif choice == "3":
            verify_integrity()
        elif choice == "4":
            break
        else:
            print("Choix invalide.")

if __name__ == '__main__':
    menu()
